pragma solidity >=0.8.0;

contract FiniteLoopContract {
    uint public count;

    constructor() public {
        count = 0;
    }

    function incr(uint n) public {
        uint i=0;
        while (i<n) {
            count=count+1;
            i+=1;
        }
    }
}
